import React from 'react';
import '../css/NavBar.css'

const Home = () => {
    return(
        <div style="searchBody">
            <div style="searchTextBody">
                <h1>Hoşgeldiniz.</h1>
                <p>Milyonlarca film, TV şovu ve keşfedilecek kişi. Şimdi keşfedin.</p>
            </div>
        </div>
    )
}

export default Home;
